class SubmissionStatusLabelRetriever:
    def __init__(self):
        self.submission_status_labels = {}

    def retrieve_submission_status_label(self, submission_status):
        if submission_status in self.submission_status_labels:
            print(f"Submission status label for {submission_status} is: {self.submission_status_labels[submission_status]}")
        else:
